async function Print(t){let e=window.open(`/panel/itemized.php?id=${t}`,"PRINT","width=1280,height=720");e.document.close(),e.onload=()=>{e.focus(),e.print(),e.close()}}async function Pay(t,e,n,a){let c={card:e,card_exp:a,card_cvc:n},o=await $.post(`/assets/php/payments.inc.php?id=${t}`,c).then();try{return JSON.parse(o)}catch{return{error:"Unable to parse output as json!",output:o}}}